def get_iis_object_schema(iis_version):
    """"""
    iis_schema = []
    if iis_version == 6.0:
        iis_schema.append({'object_name': 'IIsApplication', 'contained_in': 'IIsWebVirtualDir', 'properties': ['AppPoolId', 'AppPoolName', 'AppPoolStatus']})
        iis_schema.append({'object_name': 'IIsWebServer', 'contained_in': 'IIsComputer', 'properties': ['ServerComment', 'ServerBindings']})
    elif iis_version >= 7.0:
        iis_schema.append({'object_name': 'ApplicationPool', 'contained_in': 'Computer', 'properties': ['Name', 'AutoStart', 'Enable32BitAppOnWin64']})
